; {RESOURCE_URL}/appbuilder/images/editor_intro/preview_dataobject.png
ATTREDIT_INFO_BIZDATAOBJINFOFORM_FLD_PREVIEW_TEXT="{RESOURCE_URL}/appbuilder/images/editor_intro/preview_dataobject.png"
; Data Object is the middle layer between your application and database. You can bind a data column from database table to a data object field. A data object can also manage join table logic. The column could be bind from main table or join table.Data object can also handle ORM mapping, you can setup 1-M, M-M,self-self,between data objects.\nYou can control user access update and delete permission on data level, if the user don't have required permission, it will prompt a warning message.
ATTREDIT_INFO_BIZDATAOBJINFOFORM_FLD_DESC_TEXT="Data Object is the middle layer between your application and database. You can bind a data column from database table to a data object field. A data object can also manage join table logic. The column could be bind from main table or join table.Data object can also handle ORM mapping, you can setup 1-M, M-M,self-self,between data objects.\nYou can control user access update and delete permission on data level, if the user don't have required permission, it will prompt a warning message."
; Form Metadata Editing Hints
ATTREDIT_INFO_EASYFORMINFOFORM_TITLE="Form Metadata Editing Hints"
; Form object is the main part of the page
ATTREDIT_INFO_EASYFORMINFOFORM_FLD_FORM_DESCRIPTION_TEXT="Form object is the main part of the page"
; Form object is the main part of the page , it controls data objects display logic and user interactions,  There are 5 main types of form object, like List form , Detail form, New form, Edit form and Copy form. sometimes small data widget is also a type of FormObject. like data picker.\nTo customize the form layout , you can use either Smarty template or PHP template engine.\nYou can also control user access permission on form level, \nif the user don't have required permission it will not show the form .
ATTREDIT_INFO_EASYFORMINFOFORM_FLD_DESC_TEXT="Form object is the main part of the page , it controls data objects display logic and user interactions,  There are 5 main types of form object, like List form , Detail form, New form, Edit form and Copy form. sometimes small data widget is also a type of FormObject. like data picker.\nTo customize the form layout , you can use either Smarty template or PHP template engine.\nYou can also control user access permission on form level, \nif the user don't have required permission it will not show the form ."
; View object is the entire web page as usual
ATTREDIT_INFO_EASYVIEWINFOFORM_FLD_FORM_DESCRIPTION_TEXT="View object is the entire web page as usual"
; {RESOURCE_URL}/appbuilder/images/editor_intro/preview_view.png
ATTREDIT_INFO_EASYVIEWINFOFORM_FLD_PREVIEW_TEXT="{RESOURCE_URL}/appbuilder/images/editor_intro/preview_view.png"
; View object is the entire web page as usual. it is the main container of forms. you can mount specified form object into current editing view object to let the form displays on page.\nView object usually used for control the page layout . it supports Smarty template engine and PHP template engine. \n\nYou can also control user access permission on view level . if the user don't have required permission it will redirect to an error page.
ATTREDIT_INFO_EASYVIEWINFOFORM_FLD_DESC_TEXT="View object is the entire web page as usual. it is the main container of forms. you can mount specified form object into current editing view object to let the form displays on page.\nView object usually used for control the page layout . it supports Smarty template engine and PHP template engine. \n\nYou can also control user access permission on view level . if the user don't have required permission it will redirect to an error page."
